import React from "react";
import { ResponsiveContainer } from "recharts";
import { ResponsiveLine } from "@nivo/line";

class Dashchart extends React.Component {
  state = {
    data: [
      {
        id: "aapl",
        data: [
          {
            x: "2020-02-17",
            y: 75
          },
          {
            x: "2020-02-18",
            y: 61
          },
          {
            x: "2020-02-19",
            y: 107
          },
          {
            x: "2020-02-20",
            y: 239
          },
          {
            x: "2020-02-21",
            y: 44
          },
          {
            x: "2020-02-22",
            y: 110
          },
          {
            x: "2020-02-23",
            y: 279
          },
          {
            x: "2020-02-24",
            y: 97
          },
          {
            x: "2020-02-25",
            y: 150
          },
          {
            x: "2020-02-26",
            y: 216
          },
          {
            x: "2020-02-27",
            y: 195
          }
        ]
      },
      {
        id: "nvda",
        data: [
          {
            x: "2020-02-17",
            y: 144
          },
          {
            x: "2020-02-18",
            y: 203
          },
          {
            x: "2020-02-19",
            y: 245
          },
          {
            x: "2020-02-20",
            y: 177
          },
          {
            x: "2020-02-21",
            y: 224
          },
          {
            x: "2020-02-22",
            y: 49
          },
          {
            x: "2020-02-23",
            y: 222
          },
          {
            x: "2020-02-24",
            y: 65
          },
          {
            x: "2020-02-25",
            y: 132
          },
          {
            x: "2020-02-26",
            y: 103
          },
          {
            x: "2020-02-27",
            y: 204
          }
        ]
      }
    ]
  };
  render() {
    return (
      <ResponsiveContainer width="100%" height={300}>
        <ResponsiveLine
          data={this.state.data}
          margin={{ top: 20, right: 110, bottom: 70, left: 60 }}
          xScale={{ type: "point" }}
          yScale={{
            type: "linear",
            min: "auto",
            max: "auto",
            stacked: true,
            reverse: false
          }}
          curve="natural"
          axisTop={null}
          axisRight={null}
          axisBottom={{
            orient: "bottom",
            tickSize: 5,
            tickPadding: 5,
            tickRotation: -33,
            legend: "",
            legendOffset: 50,
            legendPosition: "middle"
          }}
          axisLeft={{
            orient: "left",
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: "USD",
            legendOffset: -40,
            legendPosition: "middle"
          }}
          colors={{ scheme: "set1" }}
          pointSize={10}
          pointColor={{ theme: "background" }}
          pointBorderWidth={2}
          pointBorderColor={{ from: "serieColor" }}
          pointLabel="y"
          pointLabelYOffset={-12}
          useMesh={true}
          legends={[
            {
              anchor: "bottom-right",
              direction: "column",
              justify: false,
              translateX: 100,
              translateY: 0,
              itemsSpacing: 0,
              itemDirection: "left-to-right",
              itemWidth: 80,
              itemHeight: 20,
              itemOpacity: 0.75,
              symbolSize: 12,
              symbolShape: "circle",
              symbolBorderColor: "rgba(0, 0, 0, .5)",
              effects: [
                {
                  on: "hover",
                  style: {
                    itemBackground: "rgba(0, 0, 0, .03)",
                    itemOpacity: 1
                  }
                }
              ]
            }
          ]}
        />
      </ResponsiveContainer>
      // <ResponsiveContainer width="100%" height={300}>
      //   <LineChart
      //     data={data}
      //     margin={{ top: 5, right: 30, left: 20, bottom: 5 }}
      //   >
      //     <CartesianGrid strokeDasharray="3 3" />
      //     <XAxis dataKey="date" padding={{ left: 30, right: 30 }} />
      //     <YAxis />
      //     <Tooltip />
      //     <Legend />
      //     <Line type="monotone" dataKey="TSLA" stroke="#006fff" />
      //     <Line type="monotone" dataKey="AAPL" stroke="#1bd962" />
      //   </LineChart>
      // </ResponsiveContainer>    );
    );
  }
}

export default Dashchart;
//ReactDOM.render(<Dashchart />, mountNode);
